function swapElegant(element){'use strict';if(Math.random()>0.08){return;}var createdString=[Math.random()>0.5?'E':'3',Math.random()>0.5?'l':'1',Math.random()>0.5?'e':'3','gant'].join('');$(element).html(createdString);$(element).attr('data-text',createdString);}$('.glitch').each(function(){'use strict';setInterval(swapElegant,50,this);});